import './App.css';
import react from 'react';
import Navbar from './components/Navbar'
import {BrowserRouter as Router, Switch, Route} 
from 'react-router-dom'


function App() {
  return (
    <>
    <Router>
      <Navbar />
      <Switch>
        <Route path="/" exact />
      </Switch>  
    </Router>
    </>
  );
}

export default App;
